import './app.css';
import React from "react";
import Navbar from './components/Navbar.js'
import AboutPage from './about.js';
import ProjectsPage from './projects.js';
import ContactPage from './contact.js'
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';


import "bootstrap/dist/css/bootstrap.min.css";
import ExamplesList from './view/ExampleList';

// Create routes for the endpoints: main page, report page, and about page
const App = () => {
    return (
        <Router>
            <div className="container">
                <nav className="navbar navbar-expand-lg navbar-light bg-light">
                    <Link to="/" className="navbar-brand">MERN Stack CRUD</Link>
                    <div className="collpase navbar-collapse">
                        <ul className="navbar-nav mr-auto">
                            <li className="navbar-item">
                                <Link to="/" className="nav-link">Examples</Link>
                            </li>
                            <li className="navbar-item">
                                <Link to="/create" className="nav-link">Create Example</Link>
                            </li>
                        </ul>
                    </div>
                </nav>
                <br/>
                <Route path="/" exact component={ExamplesList} />
            </div>
        </Router>
    );
}

export default App;
